import styles from "./style.module.css";
import { ToolBar } from "../../components/ToolBar";
import BurgerPage from "../BurgerPage";
import SideBar from "../../components/SideBar";
function App() {
  return (
    <div>
      <ToolBar />
      <SideBar />
      <main className={styles.Content}>
        <BurgerPage />
      </main>
    </div>
  );
}

export default App;
